	('0432a6dd-ce9b-4e84-8512-2b65ce07e17c', '["https://advzjsvmhis3riqi.public.blob.vercel-storage.com/1752224193329-zq02772qn-Ujhdjb8iWJHs3taefyMbda4avBSsIj.webp"]', '{"ar": "", "en": "JOHN MATHEW"}', '{"ar": "", "en": "PROJECT MANAGER"}', '2025-09-30 07:33:29.535348+00', '2025-09-30 07:33:29.535348+00', '{"ar": "", "en": "Organized and goal-oriented project manager with a knack for aligning teams and timelines, committed to delivering high-quality results through clear communication and strategicplanning."}'),
	('e73417ae-a2aa-4b7a-9471-3f694f6237a0', '["https://advzjsvmhis3riqi.public.blob.vercel-storage.com/1756101169212-z2hlihodn-Rh0i87e2v19zsyxW4V1bRCuPJVhzkM.webp"]', '{"ar": "", "en": "DIVYANI VERMA"}', '{"ar": "", "en": "GRAPHIC DESIGNER"}', '2025-09-30 07:34:38.406032+00', '2025-09-30 07:34:38.406032+00', '{"ar": "", "en": "Our talented Graphic Designer, with an eye for detail and a passion for turning ideas into stunning visuals. She is the creative force behind our brand''s unique look.With a  remarkable ability to blend artistry with strategy, she ensures every design not only looks incredible but also effectively communicatesourmessage."}'),
	('4a2bb31d-1982-4aac-b708-64d75de4efb8', '["https://advzjsvmhis3riqi.public.blob.vercel-storage.com/a8606bbe-7f76-4a92-b91a-89909e3ed4ca_page-0001-7DnGibJ3hKGaGkGODQ4vWGileqtYff.webp"]', '{"ar": "", "en": "KASHIF ADNAN"}', '{"ar": "", "en": "CLIENT SOLUTIONS MANAGER"}', '2025-09-30 07:35:19.90564+00', '2025-09-30 07:35:19.90564+00', '{"ar": "", "en": "He is the driving force behind our sales team, bringing a dynamic and results-driven approach to every client interaction. With a deep understanding of the market and a passion for building lasting relationships, he leads our team in providing tailored solutions that not only meet but exceed our clients''expectations."}'),
	('a71d1988-9d64-4edc-8aec-666c2a4a3bfe', '["https://advzjsvmhis3riqi.public.blob.vercel-storage.com/1752210935994-3uf5ocyuv-Akf03N3qc27KoO5DLH2B9iuTiSplry.webp"]', '{"ar": "", "en": "NEHA JAYAN"}', '{"ar": "", "en": "MARKETING SPECIALIST"}', '2025-09-30 07:37:06.99383+00', '2025-09-30 07:37:06.99383+00', '{"ar": "", "en": "Dynamic and results-driven professional with a sharp understanding of market trends, committed to crafting impactful campaigns that elevatebrandpresence."}'),
	('e699e217-ef42-44d6-917d-da85923dc85b', '["https://advzjsvmhis3riqi.public.blob.vercel-storage.com/bilal%20ahmed-VkD31uMpiQSOT4gDjU6Cjwq6tAz2TL.webp"]', '{"ar": "", "en": "BILAL AHMED"}', '{"ar": "", "en": "ESTIMATOR"}', '2025-09-30 07:37:44.135309+00', '2025-09-30 07:37:44.135309+00', '{"ar": "", "en": "The meticulous mind who transforms blueprints into precise financial forecasts. With an unparalleled eye for detail and a strategic understanding of market dynamics, they don''t just calculate costs; they architectvalue."}'),
	('c2345502-c072-4be5-a67f-2db67646edb2', '["https://advzjsvmhis3riqi.public.blob.vercel-storage.com/1752210963098-fzv4x4xjx-Jn8BmXeOBryVaMQYyOE85coMxco97w.webp"]', '{"ar": "", "en": "FATHIMA NAJIYA"}', '{"ar": "", "en": "SENIOR DESIGNER"}', '2025-09-30 07:40:32.864327+00', '2025-09-30 07:40:32.864327+00', '{"ar": "", "en": "She has a gift for truly listening to our clients. She believes that the best design is a collaboration, and she excels at guiding businesses through the creative process with ease and expertise. Her signature style is defined by her meticulous attention to detail and her sophisticated layering of textures and materials."}'),
	('02270cc8-64eb-49b2-ba5b-548797014fb8', '["https://advzjsvmhis3riqi.public.blob.vercel-storage.com/1756725935664-bmgpo0j37-KQPbTPVWHVjjSWKvKdAlvU1h5Mnq98.webp"]', '{"ar": "", "en": "VIVEK GEORGE"}', '{"ar": "", "en": "FINANCIAL ANALYST"}', '2025-09-30 07:32:38.070409+00', '2025-09-30 07:32:38.070409+00', '{"ar": "", "en": "He plays a vital role in shaping the financial strength of our organisation. With sharp analytical skills and a deep understanding of market trends, he transform complex data into clear insights that guide our business decisions. Their ability to forecast, evaluate risks, and identify opportunities ensures we remain competitive and forward-looking."}');
